import React, { useState, useEffect } from 'react';
import {
  Box,
  Typography,
  CircularProgress,
  Button,
  Slider,
  Alert
} from '@mui/material';
import { Line, Bar, Pie } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, PointElement, LineElement, BarElement, ArcElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, BarElement, ArcElement, Title, Tooltip, Legend);

function DeviceAnalytics({ deviceId }) {
  const [loading, setLoading] = useState(true);
  const [chartData, setChartData] = useState({});
  const [chartType, setChartType] = useState('line'); // 'line', 'bar', 'pie'
  const [dataRange, setDataRange] = useState([0, 24]); // Default range for data points
  const [maxDataPoints, setMaxDataPoints] = useState(100); // Set this to a realistic upper limit based on your data
  const [dataAvailable, setDataAvailable] = useState(true); // State to track if data is available

  useEffect(() => {
    setLoading(true);
    fetch(`http://localhost:5001/api/devices/${deviceId}`)
      .then(res => res.json())
      .then(device => {
        if (!device) {
          setDataAvailable(false); // Set no data available if the device or data array is empty
          setLoading(false);
          return;
        }
        // Calculate the maximum length of the data arrays
        const maxLength = Math.max(
          device.waterFlow.length,
          device.pressure.length,
          device.temperature.length
        );
        setMaxDataPoints(maxLength);
        setDataRange([0, maxLength]); // Set the initial range based on data length
        processData(device);
        setLoading(false);
        setDataAvailable(true);
      })
      .catch(error => {
        console.error("Error fetching device data:", error);
        setLoading(false);
        setDataAvailable(false);
      });
  }, []);

  const processData = (device) => {
    // Check and adjust the data range to ensure it doesn't exceed the array lengths
    const maxIndex = Math.min(
      device.waterFlow.length,
      device.pressure.length,
      device.temperature.length,
      dataRange[1] // Ensure the upper bound does not go out of any array's bounds
    );

    // Ensure the lower bound is not negative
    const minIndex = Math.max(0, dataRange[0]);

    // Slicing arrays safely
    const labels = device.timestamps ? device.timestamps.slice(minIndex, maxIndex) : [];
    const waterFlowData = device.waterFlow ? device.waterFlow.slice(minIndex, maxIndex) : [];
    const pressureData = device.pressure ? device.pressure.slice(minIndex, maxIndex) : [];
    const temperatureData = device.temperature ? device.temperature.slice(minIndex, maxIndex) : [];

    const data = {
      labels,
      datasets: [
        {
          label: 'Water Flow (L/s)',
          data: waterFlowData,
          borderColor: 'rgb(75, 192, 192)',
          backgroundColor: 'rgba(75, 192, 192, 0.5)',
        },
        {
          label: 'Pressure (psi)',
          data: pressureData,
          borderColor: 'rgb(255, 99, 132)',
          backgroundColor: 'rgba(255, 99, 132, 0.5)',
        },
        {
          label: 'Temperature (°C)',
          data: temperatureData,
          borderColor: 'rgb(53, 162, 235)',
          backgroundColor: 'rgba(53, 162, 235, 0.5)',
        }
      ]
    };
    setChartData(data);
  };

  if (loading) {
    return <CircularProgress />;
  }

  if (!dataAvailable) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', flexDirection: 'column', alignItems: 'center' }}>
        <Alert severity="info">No data available for this device.</Alert>
      </Box>
    );
  }

  return (
    <Box>
      <Typography variant="h6" gutterBottom>
        Device Analytics: {deviceId}
      </Typography>

      {/* Slider for selecting the range of data points */}
      <Typography gutterBottom>Adjust data range:</Typography>
      <Slider
        value={dataRange}
        onChange={(event, newValue) => setDataRange(newValue)}
        valueLabelDisplay="auto"
        min={0}
        max={maxDataPoints - 1}
        marks
        step={1}
        disableSwap
      />

      {/* Buttons to switch chart types */}
      <Button variant="contained" onClick={() => setChartType('line')} sx={{ mr: 1 }}>Line Chart</Button>
      <Button variant="contained" onClick={() => setChartType('bar')} sx={{ mr: 1 }}>Bar Chart</Button>
      <Button variant="contained" onClick={() => setChartType('pie')}>Pie Chart</Button>

      {/* Conditionally render charts */}
      {chartType === 'line' && <Line data={chartData} />}
      {chartType === 'bar' && <Bar data={chartData} />}
      {chartType === 'pie' && <Pie data={chartData} />}
    </Box>
  );
}

export default DeviceAnalytics;
